import actionType from "../Constants";

const initialState={
    showCart: false,
    cart: []
}

const cartReducer =(state=initialState,action)=>{
    switch (action.type) {
        case actionType.addToCart:

            return {
                ...state,
            }

        default:
            return state;
    }
}
export default cartReducer;
